using IO.Milvus;
using IO.Milvus.Client;

namespace MilvusTry;

public static class Collection
{
    public static async Task CreateAsync(IMilvusClient milvusClient)
    {
        await milvusClient.CreateCollectionAsync(
            Constant.CollectionName,
            new[] {
                FieldType.CreateVarchar("id",36,isPrimaryKey:true),
                FieldType.CreateFloatVector("issue",1536),
            }
        );
    }

    public static async Task<MilvusMutationResult> InsertAsync(IMilvusClient milvusClient, List<string> ids, List<List<float>> vectors)
    {
        var field = new Field[]
        {
            Field.CreateVarChar("id", ids),
            Field.CreateFloatVector("issue", vectors),
        };
        var result = await milvusClient.InsertAsync(Constant.CollectionName, field);
        return result;
    }

