    public static async Task CreateIndexAsync(IMilvusClient milvusClient) => await milvusClient.CreateIndexAsync(
        Constant.CollectionName,
        "issue",
        "default",
        MilvusIndexType.IVF_FLAT,
        MilvusMetricType.L2,
        new Dictionary<string, string> { { "nlist", "1024" } });

    public static async Task<MilvusSearchResult> SearchAsync(IMilvusClient milvusClient, List<List<float>> search_vectors, List<string> search_output_fields)
    {
        var searchResult = await milvusClient.SearchAsync(
            MilvusSearchParameters.Create(Constant.CollectionName, "issue", search_output_fields)
            .WithVectors(search_vectors)
            .WithConsistencyLevel(MilvusConsistencyLevel.Strong)
            .WithMetricType(MilvusMetricType.L2)
            .WithTopK(topK: 10)
            .WithParameter("nprobe", "10")
            .WithParameter("offset", "5"));
        return searchResult;
    }
